import React from 'react';

const certs = [
  'C Language - TechYuva',
  'HTML5 - Infosys Springboard',
  'Complete Python - AajHub',
  'Java Developer - AajHub',
  'The Java Language - Coursera',
  'MongoDB Developer Toolkit - GeeksforGeeks',
  'Advanced Python - CodeChef'
];

export default function Certifications() {
  return (
    <section className="my-8">
      <h2 className="text-2xl font-semibold mb-3">Certifications</h2>
      <div className="card">
        <ul className="list-disc pl-5">
          {certs.map(c => <li key={c}>{c}</li>)}
        </ul>
      </div>
    </section>
  );
}
